import React, { Component } from 'react';
import './TodoInput.css'
import check from '../img/check.png';
class TodoInput extends Component {
    render() {
        let url = check;
        return (
            <div className="">
                <img src={url} alt=""/>
                <input type="text" placeholder="What needs to be done here?"/>
            </div>
        );        
    }
}

export default TodoInput;
